import 'rxjs/add/observable/of';
import { combineEpics } from 'redux-observable';
import { beginGoogleAuthEpic, beginGoogleLoadAuthEpic } from './auth';

export const rootEpic = combineEpics(
  beginGoogleAuthEpic,
  beginGoogleLoadAuthEpic
)
